import React, { Component } from 'react';
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import { removeItem,addQuantity,subtractQuantity} from './actions/cartActions'

class Checkout extends Component{
    render(){

       return(
            <div classNameName="container">
                <div classNameName="collection">
                    <div class="card"><div class="card-image"><img src="/static/media/item2.8779dd15.jpg" alt="Adidas" /><span class="card-title">Adidas</span><span to="/" class="btn-floating halfway-fab waves-effect waves-light red"><i class="material-icons">add</i></span></div><div class="card-content"><p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Minima, ex.</p><p><b>Price: 80$</b></p></div></div>
                </div> 
            </div>
       )
    }
}


const mapStateToProps = (state)=>{
    return{
        items: state.addedItems,
        //addedItems: state.addedItems
    }
}
const mapDispatchToProps = (dispatch)=>{
    return{
        removeItem: (id)=>{dispatch(removeItem(id))},
    }
}
export default connect(mapStateToProps,mapDispatchToProps)(Checkout)
